import React from 'react';

function AboutMe() {
  return (
    <div>
      <h1>About Me</h1>
      <p>Hi, my name is [Your Name] and I'm a [Your Profession].</p>
      <p>I'm passionate about [Your Interests] and enjoy [Your Hobbies].</p>
      <p>Feel free to contact me at [Your Email Address] if you have any questions or would like to work together!</p>
    </div>
  );
}

export default AboutMe;
